  "Quseir al-Qadim, at the M\u00f6venpick hotel, 8 km north of Quseir. Ptolemy locates Myos-Hormos at 3\u00b025\u2019 of latitude (380 km) north of Berenike, which leads to Hurghada. The Periplus Maris Erythraei indicates that this site is at 1800 stadia (330 km) from Berenike, which would lead near Safaga. However, modern authors agree to locate this port 8 km north of Quseir on the West side of the road, and a jetty made of amphorae was found by Peacock & Blue. Napoleon's team identified it as 'Vieux Qos\u00e9\u00efr'. Roman fort at Qasr Hadie and road to Nile valley": "http://data.archaeology.link/data/ancientports/3549",
