  "Somewhere in Donana park? Cerro del Trigo? The R Guadalquivir is called R Baetis by the Romans and R Tartessos by the Phoenicians before them. Tartessos is also the name of an ancient tribe who lived in this area of Huelva-Sevilla-Cadix. The ancient city of Tartessos is possibly located here.The Bible mentions Tarshish several times. Pausanias (Greece, 6, 19) locates it near the outlet of the Guadalquivir. However, Avienus indicates in his Ora Maritima that Tartessus is the ancient name of Gaddir. Pliny (Nat Hist, 3, 3) locates Tartessos at Carteia. Some believe it is Huelva.": "http://data.archaeology.link/data/ancientports/310",
